INSERT INTO `JournalArticle` VALUES ('6beedfad-4cc6-41c0-99e0-62d449ff1917',20602,20603,20184,20155,20159,'','2017-01-23 17:56:54','2017-01-23 17:56:54',0,0,0,'/0/','WELCOME',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<dynamic-element name=\"content\" type=\"text_area\" index-type=\"keyword\" index=\"0\">\n		<dynamic-content language-id=\"en_US\"><![CDATA[\n			\n				<style type=\"text/css\">\n					h2.welcome-title {\n						font-size: 35px;\n						margin: 0 0 40px;\n					}\n\n					h4.subtitle {\n						font-size: 24px;\n						line-height: 30px;\n						margin-bottom: 0;\n					}\n\n					.welcome-content {\n						font-size: 15px;\n						margin: 0;\n					}\n\n					.welcome-content a {\n						text-decoration: none;\n					}\n\n					.welcome-content a:hover {\n						text-decoration: underline;\n					}\n\n					.welcome-content .welcome-text {\n						line-height: 22px;\n						margin: 0;\n					}\n\n					.welcome-content .pdf {\n						display: inline-block;\n						margin-top: 25px;\n					}\n\n					.welcome-content .welcome-icon {\n						float: left;\n						margin: 4px 0;\n						padding-right: 38px;\n					}\n\n					@media all and (max-width: 767px) {\n						h2.welcome-title {\n							font-size: 24px;\n						}\n\n						h4.subtitle {\n							margin: 32px 0 4px;\n						}\n\n						.welcome-content-wrapper {\n							text-align: center;\n						}\n\n						.welcome-content .welcome-icon {\n							float: none;\n							padding: 0;\n						}\n					}\n				</style>\n\n				<div class=\"welcome-content-wrapper\">\n					<h2 class=\"welcome-title\">\n						Welcome To Liferay Portal\n					</h2>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20184/0/welcome_cube/10ab9fa2-5ad5-4372-9bc8-8d7c58041081?version=1.0&t=1485190613954\" />\n\n						<h4 class=\"subtitle\">\n							Start\n						</h4>\n\n						<p class=\"welcome-text\">\n							Review our <a href=\"http://www.liferay.com/welcome-start?v1.0\" target=\"_blank\">Quick Start Guide</a> for an overview of Liferay\'s features.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20184/0/welcome_learn/490fb45b-60d4-4e2b-b537-1776252e715c?version=1.0&t=1485190614471\" />\n\n						<h4 class=\"subtitle\">\n							Learn\n						</h4>\n\n						<p class=\"welcome-text\">\n							Read the official <a href=\"http://www.liferay.com/welcome-learn?v1.0\" target=\"_blank\">Liferay User Guide</a> for detailed information about setting up and configuring Liferay.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20184/0/welcome_community/a19665d6-0e61-49d4-815e-1d7117ea2ac7?version=1.0&t=1485190614422\" />\n\n						<h4 class=\"subtitle\">\n							Engage\n						</h4>\n\n						<p class=\"welcome-text\">\n							Visit the <a href=\"http://www.liferay.com/welcome-engage?v1.0\" target=\"_blank\">Liferay Community</a> to post questions, find answers, and contribute.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20184/0/welcome_tools/49b6b715-3dd0-4619-aa1b-0f6cc14562ad?version=1.0&t=1485190614592\" />\n\n						<h4 class=\"subtitle\">\n							Develop\n						</h4>\n\n						<p class=\"welcome-text\">\n							Explore our <a href=\"http://www.liferay.com/welcome-develop?v1.0\" target=\"_blank\">Developer Resources</a> to develop apps and more for Liferay Portal.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/document